	add("frost", "{\"term\":\"frost\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Latin\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027frost\u0027 from Old english (ca. 450-1100) \u0027frost\u0027 (frost) from Proto-germanic {{m|gem-pro|*frustaz||frost}}, from Proto-indo-european {{m|ine-pro|*prews-||to freeze; frost}}. Cognate with West Frisian \u0027froast\u0027 (frost) Dutch \u0027vorst\u0027 (frost) German \u0027frost\u0027 (frost) Swedish \u0027frost\u0027 (frost) Icelandic \u0027frost\u0027 (frost) Latin {{m|la|pruīna||hoarfrost, frost, rime, snow}}. Related to {{l|en|freeze}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cover of minute ice crystals on objects that are exposed to the air. Frost is formed by the same process as dew, except that the temperature of the frosted object is below freezing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027. David Hume. \u0027Enquiries concerning the human understanding and concerning the principles of moral.\u0027 London: Oxford University Press, 1973. § 47\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is more probable, in almost every country of Europe, that there will be \u0027\u0027frost\u0027\u0027 sometime in January, than that the weather will continue open throughout that whole month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The cold weather that causes these ice crystals to form\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Coldness or insensibility; severity or rigidity of character\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was one of those moments of intense feeling when the \u0027\u0027frost\u0027\u0027 of the Scottish people melts like a snow-wreath\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The act of freezing; the congelation of water or other liquid\", \"priority\":8}]}, \"synonyms\":{}}");

